import styles from './Modal.module.css';

function Modal(props) {
  const classes = 'modal ' + props.className;
  return (
    <div classname={styles['modal-container']}>
      <div className={styles[classes]}>{props.children}</div>
    </div>
  );
}

export default Modal;
